window.bookSummaryJSON = "<p><b>Everything has a price. Pangea Online is no different.</b>&nbsp;</p> <p>Since leaving the orphanage, Esil has spent the past year toiling in the data mines of Pangea while watching the wealthy elite traverse its myriad of game worlds. His luck changes forever when he discovers a legendary Developer's Chest. The Premium Worldpass inside grants him unlimited access to all of Pangea.&nbsp;</p> <p>Now, Esil isn't just stuck watching as others explore Pangea. He can finally level up.&nbsp;</p> <p>With his newfound fortune, he enters a tournament to compete against some of the most skilled adventurers Pangea has to offer. Heâ€™s a long shot to win, but for the first time in his life, being a kid from the slums has its advantages when he discovers a bug in the obscure data-mining class.&nbsp;</p> <p>With an even playing field, he might just have a shot.&nbsp;</p> <p>But his in-game actions have real-world consequences and failure online threatens everything he holds dear.&nbsp;</p> <p><b>Pick up the complete litrpg trilogy in one epic omnibus edition!</b>&nbsp;</p> <p><b>The </b><b><i>Pangea Online</i></b><b> omnibus edition contains: </b></p> <p><b><i>Pangea Online: Death and Axes </i></b><br> <b><i>Pangea Online 2: Magic and Mayhem </i></b><br> <b><i>Pangea Online 3: Vials and Tribulations</i></b></p>"; 
